    fun test1() {
        val s = "baeyh"
        val k = 2
        val expected = 2L

        assertEquals(expected, CountBeautifulSubstringsII.beautifulSubstrings(s, k))
    }

    @Test
    fun test2() {
        val s = "abba"
        val k = 1
        val expected = 3L

        assertEquals(expected, CountBeautifulSubstringsII.beautifulSubstrings(s, k))
    }

    @Test
    fun test3() {
        val s = "bcdf"
        val k = 1
        val expected = 0L

        assertEquals(expected, CountBeautifulSubstringsII.beautifulSubstrings(s, k))
    }

    @Test
    fun test4() {
        val s = ""
        val k = 11
        val expected = 618610L

        assertEquals(expected, CountBeautifulSubstringsII.beautifulSubstrings(s, k))
    }

    @Test
    fun test5() {
        val s = "eeebjoxxujuaeoqibd"
